import React from "react";
import "./Home.css";

export default function Home() {
    return (
        <div className="Home">
                <div className="lander">
                    <h1>P u r d u e C i r c l e</h1>
                <p className="text-muted">A social media app exclusively for Purdue students!</p>
                </div>
        </div>
    );

}
